import React, { useState } from "react";
import Dialog from "@material-ui/core/Dialog";
import IconButton from "@material-ui/core/IconButton";
import CloseIcon from "@material-ui/icons/Close";
import CarMaintenceForm from './CarMaintenenceForm';
import CarMaintenceShow from './CarMaintenenceShow';
import Switch from '@material-ui/core/Switch';
import { makeStyles } from '@material-ui/core/styles';
import Fab from '@material-ui/core/Fab';
import AddIcon from '@material-ui/icons/Add';
import { green } from '@material-ui/core/colors';
import CarFixAddModal from './CarFixAddModal';
import { axiosWithAuth } from '../helpers/index';
import CarCard from './CarCard'
import Grid from '@material-ui/core/Grid';
import Tooltip from '@material-ui/core/Tooltip';
import FormControl from '@material-ui/core/FormControl';
import Button from '@material-ui/core/Button';
import CloudUploadIcon from '@material-ui/icons/CloudUpload';
import CarImgUpload from './CarImgUpload'


import '../styles/fullscreenmodal.scss'



const useStyles = makeStyles(theme => ({
    modalWidth: {
        margin: theme.spacing(1),
        width: 200,
      },
      paper: {
        backgroundColor: theme.palette.background.paper,
        border: '1px solid #000',
        boxShadow: theme.shadows[5],
        padding: theme.spacing(2),
        outline: 'none',
        display: 'flex',
        flexDirection: 'column',
        justifyContent: 'center',
        alignItems: 'center',

    },

}));




function ImageUploadModal(props) {
  const classes = useStyles();


  const [open, setOpen] = useState(false);
  const [errorOpen, setErrorOpen] = useState(false);


  function handleOpen() {
    setOpen(true);
  }
  function handleErrorOpen() {
    setErrorOpen(true);
  }
  function handleClose() {
    setOpen(false);
  }
  function handleErrorClose() {
    setErrorOpen(false);
  }




  return (
    <>
      <Dialog  style={{width:"350px",height:"700px"}} open={props.open} onClose={props.handleClose}  >
      <FormControl  >
      <CarImgUpload/>

        </FormControl>

      </Dialog>

    </>
  )
}


export default ImageUploadModal;
